svg.script:
function show_aedc6222(evt, text) {
	var pos = (evt.target.getAttribute("y") < 574) ? "bottom" : "top";
	var note = document.getElementById(pos + "_note_aedc6222");
	note.textContent = text;
	note.setAttributeNS(null, "visibility", "visible");
	document.getElementById(pos + "_overlay_aedc6222").setAttributeNS(null, "visibility", "visible");
}
function hide_aedc6222(evt) {
	document.getElementById("top_note_aedc6222").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("top_overlay_aedc6222").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("bottom_note_aedc6222").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("bottom_overlay_aedc6222").setAttributeNS(null, "visibility", "hidden");
}
